import { makeAutoObservable } from 'mobx';
import React from 'react';
import { runInThisContext } from 'vm';

export interface IBrand {
    id?: number;
    name?: string;
    deleted?: boolean;
}

class BrandStore {

    _brands!: IBrand[];

    constructor() {
        makeAutoObservable(this);
    }

    set(brands: IBrand[]) {
        this._brands = brands;
    }
    get() {
        return this._brands;
    }

}

export default BrandStore;
